import React from 'react'
import '../styling/Crossfade.css'

class Crossfade extends React.Component {
  render() {
    return (
      <div className='crossfade'>
        <div className='background' id='pic-1'></div>
        <div className='background' id='pic-2'></div>
      </div>
    )
  }
}

export default Crossfade
